import axios from "axios";
import React, {useEffect, useState} from 'react';
import GroupList from '../components/GroupList'


function Home(){
    const [flag, setFlag] = useState(false)
    //const [groupList, setGroupList] = useState([])
    let groupList = []

    const changeFlag = () =>{
      setFlag(!flag)
    }
    useEffect(() => {
      const load_g = async ()=>{
        const res = await axios.get('http://127.0.0.1:8000/api/groups/')
        //await setGroupList(res.data)\
        groupList = res.data
        console.log(groupList)
      }
      load_g()
  
    }, [flag, groupList])

    return(
    <section className="Home">
      <div className="owned-groups">
      {groupList?.map(group =>
        <GroupList key = {group.id-1} name = {group.name} description = {group.description} changeFlag = {changeFlag}/>
        )}
      </div>
    </section>
      )
  }

  export default Home;
